[{:mapcodes {:label "Coding Maps", :opts {:order :row, :eltsper 1, :size "auto", :wrapfn {:tid :mapcodes, :$split nil, :out-width "1300px", :fn [quote editor-repl-tab], :layout :left-right, :ns cov2.code, :ed-out-order :first-last, :width "760px", :md-defaults nil, :src "\n\n:clj\n(def vgdata-base\n  \"https://raw.githubusercontent.com/vega/vega-datasets/master/data/\")\n\n;;; We need the Vega geo state ID codes\n(def name->id\n  (-> (str vgdata-base \"income.json\") slurp (json/read-str :key-fn keyword)\n    (->> (group-by :name)\n      (mapv (fn[[state v]] [state ((first v) :id)]))\n      (into {}))))\n\n\n(def state->pop\n  {\"Montana\" 1086759, \"California\" 39937489, \"Washington\" 7797095\n   \"Massachusetts\" 6976597, \"Mississippi\" 2989260, \"Kentucky\" 4499692\n   \"Wyoming\" 567025, \"Pennsylvania\" 12820878, \"Colorado\" 5845526\n   \"Illinois\" 12659682, \"Virginia\" 8626207, \"Idaho\" 1826156\n   \"Nebraska\" 1952570 \"Vermont\" 628061, \"Louisiana\" 4645184\n   \"New Jersey\" 8936574, \"Ohio\" 11747694, \"Oklahoma\" 3954821\n   \"New Mexico\" 2096640, \"Georgia\" 10736059, \"Iowa\" 3179849\n   \"Rhode Island\" 1056161, \"North Dakota\" 761723, \"New Hampshire\" 1371246\n   \"Tennessee\" 6897576, \"Michigan\" 10045029, \"North Carolina\" 10611862\n   \"District of Columbia\" 720687, \"Hawaii\" 1412687, \"Kansas\" 2910357\n   \"Maryland\" 6083116, \"Connecticut\" 3563077, \"Oregon\" 4301089\n   \"South Dakota\" 903027, \"Arizona\" 7378494, \"New York\" 19440469\n   \"Wisconsin\" 5851754, \"Puerto Rico\" 3032165, \"Missouri\" 6169270\n   \"Texas\" 29472295, \"Indiana\" 6745354, \"Nevada\" 3139658, \"Utah\" 3282115\n   \"Minnesota\" 5700671, \"Alabama\" 4908621, \"Delaware\" 982895\n   \"Florida\" 21992985, \"Arkansas\" 3038999, \"Maine\" 1345790\n   \"Alaska\" 734002, \"South Carolina\" 5210095, \"West Virginia\" 1778070})\n\n\n:mixed\n\n(def vgdata-base (clj vgdata-base))\n\n\n(def state-codes\n  (clj\n   (deref\n    (def state-codes \n      [{:name \"Alabama\", :code \"AL\"} {:name \"Montana\", :code \"MT\"}\n       {:name \"Alaska\", :code \"AK\"} {:name \"Nebraska\", :code \"NE\"}\n       {:name \"Arizona\", :code \"AZ\"} {:name \"Nevada\", :code \"NV\"}\n       {:name \"Arkansas\", :code \"AR\"} {:name \"New Hampshire\", :code \"NH\"}\n       {:name \"California\", :code \"CA\"} {:name \"New Jersey\", :code \"NJ\"}\n       {:name \"Colorado\", :code \"CO\"} {:name \"New Mexico\", :code \"NM\"}\n       {:name \"Connecticut\", :code \"CT\"} {:name \"New York\", :code \"NY\"}\n       {:name \"Delaware\", :code \"DE\"} {:name \"North Carolina\", :code \"NC\"}\n       {:name \"Florida\", :code \"FL\"} {:name \"North Dakota\", :code \"ND\"}\n       {:name \"Georgia\", :code \"GA\"} {:name \"Ohio\", :code \"OH\"}\n       {:name \"Hawaii\", :code \"HI\"} {:name \"Oklahoma\", :code \"OK\"}\n       {:name \"Idaho\", :code \"ID\"} {:name \"Oregon\", :code \"OR\"}\n       {:name \"Illinois\", :code \"IL\"} {:name \"Pennsylvania\", :code \"PA\"}\n       {:name \"Indiana\", :code \"IN\"} {:name \"Rhode Island\", :code \"RI\"}\n       {:name \"Iowa\", :code \"IA\"} {:name \"South Carolina\", :code \"SC\"}\n       {:name \"Kansas\", :code \"KS\"} {:name \"South Dakota\", :code \"SD\"}\n       {:name \"Kentucky\", :code \"KY\"} {:name \"Tennessee\", :code \"TN\"}\n       {:name \"Louisiana\", :code \"LA\"} {:name \"Texas\", :code \"TX\"}\n       {:name \"Maine\", :code \"ME\"} {:name \"Utah\", :code \"UT\"}\n       {:name \"Maryland\", :code \"MD\"} {:name \"Vermont\", :code \"VT\"}\n       {:name \"Massachusetts\", :code \"MA\"} {:name \"Virginia\", :code \"VA\"}\n       {:name \"Michigan\", :code \"MI\"} {:name \"Washington\", :code \"WA\"}\n       {:name \"Minnesota\", :code \"MN\"} {:name \"West Virginia\", :code \"WV\"}\n       {:name \"Mississippi\", :code \"MS\"} {:name \"Wisconsin\", :code \"WI\"}\n       {:name \"Missouri\", :code \"MO\"} {:name \"Wyoming\", :code \"WY\"}]))))\n\n(def code->state\n  (clj (deref\n        (def code->state\n          (->> state-codes (mapv #(vector (% :code) (% :name)))\n            (into {}))))))\n\n(def state->code\n  (->> state-codes (mapv #(vector (% :name) (% :code)))\n       (into {})))\n\n\n\n\n\n\n:end", :out-height "900px", :eid "ed-mapcodes", :height "900px"}}, :specs []}} {:code {:label "Data Code", :opts {:order :row, :eltsper 1, :size "auto", :wrapfn {:tid :code, :$split nil, :out-width "1300px", :fn [quote editor-repl-tab], :layout :left-right, :ns cov2.code, :ed-out-order :first-last, :width "760px", :md-defaults nil, :src "\n\n:clj\n\n(deps '[[techascent/tech.ml.dataset \"4.04\"]])\n(require '[tech.ml.dataset :as ds]\n         '[tech.v2.datatype :as dtype])\n\n(deps '[[scicloj/tablecloth \"4.04\"]])\n(require '[tablecloth.api :as tc])\n\n(def states-daily-ds\n    (tc/dataset \"https://api.covidtracking.com/v1/states/daily.csv\"\n                {:key-fn keyword\n                 :parser-fn {:dateChecked\n                             [:string (fn[d] (-> d (str/split #\"T\") first))]}}))\n\n(def today (-> states-daily-ds\n             (tc/select-rows [0])\n             (tc/select-columns :date)\n             first second first))\n\n(def us-cols\n  [:date :state :positive :death :hospitalized :stgdate])\n\n(def daily-cols\n  [:date :state\n   :total :positive :negative :totalTestResults\n   :death :deathIncrease\n   :hospitalizedCurrently :hospitalizedCumulative :hospitalizedIncrease\n   :inIcuCumulative :inIcuCurrently])\n\n\n:none\n(tc/row-count states-daily-ds)\n(tc/column-count states-daily-ds)\n(tc/shape states-daily-ds)\n(tc/info states-daily-ds)\n\n\n:clj\n\n;;; Nice little to haves\n(defn roundit [r & {:keys [places] :or {places 2}}]\n  (let [n (Math/pow 10.0 places)]\n    (-> r (* n) Math/round (/ n))))\n\n(defn log2 [x]\n  (let [ln2 (Math/log 2)]\n    (/ (Math/log x) ln2)))\n\n\n(defn idate2stgdate [idate]\n  (let [idstg (str idate)\n        yr (subs idstg 0 4)\n        mth (subs idstg 4 6)\n        day (subs idstg 6)]\n    (str/join \"-\" [yr mth day])))\n\n(def states-daily-data\n  (-> states-daily-ds\n    (tc/select-columns daily-cols)\n    (tc/select-rows #(code->state (% :state)))\n    (tc/replace-missing :all :lerp)\n    (tc/add-or-replace-column\n     :stgdate (fn[ds]\n                (-> ds (tc/select-columns :date)\n                  tc/rows (->> (vfold #(-> % first idate2stgdate))))))\n    (tc/convert-types :stgdate :string)))\n\n(def states-daily-by-state\n  (tc/group-by states-daily-data :state {:result-type :as-map}))\n;;;(keys states-daily-by-state)\n;;;(map type (vals states-daily-by-state))\n;;;(-> (states-daily-by-state \"MA\") (tc/order-by :hospitalizedCurrently :asc))\n;;;(-> (states-daily-by-state \"MA\") (tc/rows :as-maps) (->> (take 2)))\n\n\n(def states-ds\n  (tc/select-rows states-daily-data (comp #(= % today) :date)))\n\n(def state-data\n  (-> states-ds\n    (tc/select-columns us-cols)\n    (tc/rows :as-maps)\n    (->>\n      (mapv\n       (fn[m]\n         (let [name (code->state (m :state))\n               pop (state->pop name)\n               pos (-> m :positive)\n               pos100K (-> pos (/ pop) (* 100000.0) roundit)]\n           (assoc m :name name :id (name->id name)\n                  :pop pop :pos100K pos100K)))))))\n\n\n\n\n;;; Compute rolling average of data in vector V\n(defn rolling-avg [v]\n  (let [pairs (->> v (coll/sliding-take 2) (take-while #(= 2 (count %))))\n        sum (->> pairs (map (fn[[x y]] (- x y))) (apply +) double)\n        cnt (count pairs)]\n    (roundit (/ sum cnt))))\n\n\n\n(defn ds-with-avgs [ds window]\n  (loop [cols [[:positive :posavg]\n               [:death :dthavg]\n               [:hospitalizedCumulative :hosavg]\n               [:total :totavg]]\n         ds ds]\n    (if (empty? cols)\n      ds\n      (let [[col colnm] (first cols)\n            avg (-> ds\n                   (tc/aggregate \n                    (fn[ds]\n                      (->> (ds col)\n                        (coll/sliding-take window)\n                        (take-while #(= (count %) window))\n                        (map rolling-avg))))\n                   tc/rows vec first)\n            nds (-> (tc/add-or-replace-column ds colnm avg :na)\n                (tc/replace-missing colnm :value 0.0)\n                (tc/convert-types colnm :float64))]\n        (recur (rest cols) nds)))))\n\n(defn states-ds-with-avgs [states window]\n    (vec (for [state states]\n           (-> state states-daily-by-state (ds-with-avgs window)))))\n\n\n\n\n:mixed\n\n;;; Overview data\n(def state-data (clj state-data))\n\n\n;;; Daily stuff\n;;;\n\n(defn states-daily-data [states window]\n  (let [[cols data] (clj (let [dsets (states-ds-with-avgs states window)\n                               cols (-> dsets first tc/column-names)\n                               data (mapv tc/rows dsets)]\n                           [cols data]))]\n    (mapv (fn[st]\n            (map (fn[v]\n                   (let [m (zipmap cols v)\n                         pa (m :posavg)\n                         ta (m :totavg)\n                         pp (if (= ta 0) 0 (/ pa ta))\n                         state (m :state)]\n                     (assoc m :perpos (* 100.0 pp)\n                            :code state\n                            :state (code->state state))))\n                 st))\n          data)))\n\n\n(def daily-memoized\n  (memoize states-daily-data))\n\n(let [x (daily-memoized [\"MA\"] 7)]\n  (def daily-increase x) 'daily-increase)\n;;;(ffirst daily-increase)\n;;;(->> daily-increase first (take 2))\n\n\n\n\n\n\n\n:none\n\n;;; JVM only\n(->> (states-daily-by-state \"MA\") first (sort-by first))\n\n(->> states-daily-by-state\n  (filter (fn[[k v]] (code->state k)))\n  (filter (fn[[state data]] (filter #(not (string? (% :dateChecked))) data)))\n  first second\n  (filter #(not (string? (% :dateChecked)))))\n\n\n;;; Mixed stuff\n(get-data-set \"MA\" 7 (sc/get-cur-date) \"2020-08-09\")\n\n;;; Broken - check out\n(->> (get-data-set \"NY\" 7 0 0)\n  (filter #(= \"increase\" (% :field)))\n  (take 3))\n\n(first (clj (range 9)))\n(first (state-daily-data \"NY\" 7))\n(take 3 (clj (range 9)))\n(take 3 (state-daily-data \"NY\" 7))\n\n(->> \"NY\" daily-increase first)\n(->> \"AL\" daily-increase count)\n\n\n\n(def foo\n  (let [[cols data] (clj (let [cols (tc/column-names states-daily-data)]\n                           [cols (tc/rows states-daily-data)]))]\n    (map (fn[v] (zipmap cols v)) data)))\n(count foo)\n\n(def foo\n  (let [states [\"MA\" \"MN\" \"NH\" \"VT\" \"CT\"]]\n    (let [[cols data] (clj (let [dsets (states-ds-with-avgs states 2)\n                                 cols (-> dsets first tc/column-names)\n                                 data (mapv tc/rows dsets)]\n                             [cols data]))]\n      (map (fn[st]\n             (map (fn[v]\n                    (let [m (zipmap cols v)\n                          pa (m :posavg)\n                          ta (m :totavg)\n                          pp (if (= ta 0) 0 (/ pa ta))]\n                      (assoc m :perpos (* 100.0 pp))))\n                  st))\n           data))))\n;;;(ffirst foo)\n;;;(+ 7947 232454)\n;;;(map (fn[v] (mapv (first v) [:state :posavg :totavg :perpos])) foo)\n\n\n\n\n\n:end", :out-height "900px", :eid "ed-code", :height "900px"}}, :specs []}} {:cljs2 {:label "Widgets", :opts {:order :row, :eltsper 1, :size "auto", :wrapfn {:tid :cljs2, :$split nil, :out-width "1300px", :fn [quote editor-repl-tab], :layout :left-right, :ns cov2.code, :ed-out-order :first-last, :width "730px", :md-defaults nil, :src "\n\n:cljs\n\n(def use-defaults? :aerial.hanami.common/use-defaults?)\n\n(defn xframes [frame-map & {:keys [defaults?] :or {defaults? false}}]\n  (let [submap (merge {use-defaults? defaults?} frame-map)]\n    (hc/xform\n     (hc/get-default :USERDATA)\n     submap)))\n\n(defn xc\n  ([comps submap]\n   (let [defaults? (submap :defaults? true)]\n     (hc/xform comps (merge {use-defaults? defaults?} submap))))\n  ([comps k v & kvs]\n   (let [submap (->> (cons k (cons v kvs))\n                  (partition-all 2) (mapv vec) (into {}))]\n     (xc comps submap))))\n\n(def sidebar\n  [['p {:style {:width \"50px\" :min-width \"50px\"}}]\n   ['v-box :children\n    :components]])\n\n\n(def top\n  [['gap :size :TOPGAP]\n   ['v-box :children\n    :components]])\n\n(def bottom\n  [['gap :size :BOTTOM-GAP]\n   ['h-box :children\n    :components]])\n\n\n(def basicButton\n  '[button\n    :label :BBUTTON-label\n    :tooltip :BBUTTON-tooltip\n    :tooltip-position :below-center\n    :disabled? :BBUTTON-disabled?\n    :on-click :BBUTTON-on-click\n    :class :BBUTTON-class])\n\n(def iconButton\n  '[md-icon-button\n    :md-icon-name :IBUTTON-md-icon-name\n    :tooltip :IBUTTON-tooltip\n    :tooltip-position :IBUTTON-tooltip-position\n    :disabled? :IBUTTON-disabled?\n    :on-click :IBUTTON-on-click\n    :class :IBUTTON-class])\n\n(def ciconButton\n  '[md-circle-icon-button\n    :md-icon-name :CIBUTTON-md-icon-name\n    :tooltip :CIBUTTON-tooltip\n    :tooltip-position :CIBUTTON-tooltip-position\n    :disabled? :CIBUTTON-disabled?\n    :size :CIBUTTON-size\n    :on-click :CIBUTTON-on-click\n    :class :CIBUTTON-class])\n\n\n(def checkBox\n  '[checkbox\n   :label :CHECKBOX-label\n   :model :CHECKBOX-model\n   :disabled? :CHECKBOX-disabled?\n   :label-style :CHECKBOX-label-style\n   :on-change :CHECKBOX-on-change])\n\n(def radioButton\n  '[radio-button\n   :label :RBUTTON-label\n   :value :RBUTTON-value\n   :model :RBUTTON-model\n   :label-style :RBUTTON-label-style\n   :on-change :RBUTTON-on-change])\n\n\n(def sliderInput\n  '[v-box :children\n    [[label :label [:span.bold :SLIDER-LBL]]\n     [h-box :children\n      [[label :label :MINLBL]\n       [slider\n        :model :SLIDER-MODEL\n        :min :MIN, :max :MAX, :step :STEP\n        :width :SLIDER-WIDTH\n        :on-change :SLIDER-CHG-FNSYM]\n       [label :label :MAXLBL]]]]])\n\n\n(def singleDropdown\n  ['v-box\n   :children\n   [['label :label [:span.bold :DROPDOWN-LBL]]\n    ['single-dropdown\n     :choices :CHOICES\n     :on-change :DROPDOWN-CHG-FNSYM\n     :model :DROPDOWN-MODEL\n     :placeholder :PLACEHOLDER\n     :width :DROPDOWN-WIDTH]]])\n\n(def selectionList\n  ['v-box\n   :children\n   [['label :label [:span.bold :SELECTION-LBL]]\n    ['selection-list\n     :choices :CHOICES\n     :on-change :SELECTION-CHG-FNSYM\n     :model :SELECTION-MODEL\n     :multi-select? :MULTI?\n     :required? :REQUIRED?\n     :height :SELECTION-HEIGHT\n     :width :SELECTION-WIDTH]]])\n\n\n(def textInput\n  '[input-text\n    :model :INPUT-MODEL\n    :width \"60px\", :height \"26px\"\n    :on-change :INPUT-CHG-FNSYM])\n\n(def markdown\n  ['md {:style {:font-size \"24px\" :width \"1000px\"}}\n   :MDTXT])\n\n\n\n\n(hc/update-defaults\n :BINNED-ENCODING\n {:x {:field :bin_start :type :quantitative\n      :bin {:binned true :step 2}\n      :title :XTITLE}\n  :x2 {:field :bin_end}\n  :y {:field :Y :type :quantitative}}\n :TOPGAP \"500px\" :MDTXT \"Your text here\"\n :BOTTOM-GAP \"500px\"\n :SLIDER-LBL \"**Slider Lable**\"\n :SLIDER-WIDTH \"200px\" :STEP 1.0 \n :MIN 0 :MINLBL #(-> % :MIN str)\n :MAX 10 :MAXLBL #(-> % :MAX str)\n :DROPDOWN-MODEL nil :DROPDOWN-WIDTH \"150px\"\n :SELECTION-MODEL #{} :SELECTION-WIDTH \"150px\" :SELECTION-HEIGHT \"200px\"\n :INPUT-CHG-FNSYM #(-> % :SLIDER-CHG-FNSYM)\n :INPUT-MODEL #(-> % :SLIDER-MODEL))\n(hc/add-defaults :RBUTTON-label-style hc/RMV)\n\n\n\n\n\n", :out-height "900px", :eid "ed-cljs2", :height "900px"}}, :specs []}} {:visdefs {:label "Visdefs", :opts {:order :row, :eltsper 1, :size "auto", :wrapfn {:tid :visdefs, :$split nil, :out-width "1300px", :fn [quote editor-repl-tab], :layout :left-right, :ns cov2.code, :ed-out-order :first-last, :width "730px", :md-defaults nil, :src "\n\n:cljs\n\n\n(def slider-hist\n  (-> ht/view-base\n    (assoc :mark (merge ht/mark-base {:type \"bar\"})\n           :encoding :BINNED-ENCODING\n           :usermeta\n           (xframes\n            {:TOP (xc top :defaults? false\n                      :components [markdown])\n             :LEFT (xc sidebar :defaults? false\n                       :components [sliderInput textInput])}))))\n\n\n(def layer-hist\n  (-> ht/layer-chart\n    (assoc :usermeta (xframes {:TOP top :LEFT sidebar})\n           :layer [(hc/xform\n                    ht/bar-chart :WIDTH 700\n                    :XTITLE \"Duration (in minutes)\"\n                    :ENCODING :BINNED-ENCODING :Y :Frequency\n                    :DATA :bin-data)\n                   (hc/xform\n                    ht/line-chart :WIDTH 700 :MCOLOR \"red\"\n                    :DATA :den-data)]\n           :resolve{:scale {\"y\" \"independent\" \"x\" \"independent\"}})))\n\n\n\n\n(let [mdwn-brush\n      (hc/xform ht/interval-brush-mdwn :MDWM-NAME \"brush\" :IRESOLVE \"global\")\n      color {:field \"NM\" :type \"nominal\"\n             :scale {:range [\"#e45756\" \"#54a24b\" \"#4c78a8\"]}}\n      size {:condition {:selection {:not \"brush\"} :value 40} :value 400}\n      tooltip `[{:field \"Gene\", :type \"nominal\"}\n                ~@ht/default-tooltip\n                {:field \"pvalue\", :type \"quantitative\"}]]\n  (def dge-chart\n    (-> ht/hconcat-chart\n      (assoc :hconcat\n             [(hc/xform\n               ht/point-chart :WIDTH 500 :HEIGHT 400\n               :TITLE \"MA Plot\"\n               :MSIZE 40\n               :SELECTION (merge  (hc/xform ht/interval-scales :INAME \"grid1\")\n                                  mdwn-brush)\n               :X \"baseMean\", :Y \"log2FoldChange\"\n               :COLOR color, :SIZE size, :TOOLTIP tooltip)\n              (hc/xform\n               ht/point-chart :WIDTH 500 :HEIGHT 400\n               :TITLE \"Volcano Plot\"\n               :MSIZE 40\n               :SELECTION (merge (hc/xform ht/interval-scales :INAME \"grid2\")\n                                 mdwn-brush)\n               :X \"log2FoldChange\", :Y \"-log10pval\"\n               :COLOR color, :SIZE size :TOOLTIP tooltip)]))))\n\n\n\n\n\n\n\n;;; Not a very good template - needs more and better abstraction...\n(def geo-choro\n  (assoc ht/view-base\n         :mark {:type \"geoshape\" :stroke :STROKE}\n         :encoding {:shape {:field \"geo\", :type \"geojson\"},\n                    :color {:field :X, :type \"quantitative\" :scale :YSCALE}\n                    :tooltip :TOOLTIP}\n         :projection :PROJECTION))\n\n\n\n(def us-10m (str vgdata-base \"us-10m.json\"))\n\n(def cov2-US-geo-choro\n  (-> geo-choro\n    (assoc :usermeta\n           (xframes\n            {:TOP (xc top :defaults? false :components [markdown])\n             :RIGHT (xc sidebar :defaults? false :components :rcomponents)\n             :LEFT  (xc sidebar :defaults? false :components :lcomponents)})\n           :transform\n           [{:lookup \"id\",\n             :from {:data {:url us-10m\n                           :format {:type \"topojson\" :feature \"states\"}}\n                    :key \"id\"}\n             :as \"geo\"}])))\n\n(def cov2-daily-states\n  (-> ht/layer-chart\n    (assoc :usermeta\n           (xframes\n            {:TOP (xc top :defaults? false :components [markdown])\n             :RIGHT (xc sidebar :defaults? false :components :rcomponents)\n             :LEFT  (xc sidebar :defaults? false :components :lcomponents)}))))\n\n\n\n\n\n\n\n(hc/update-defaults\n :GTTFIELD \"name\" :GTTTYPE \"nominal\"\n :PROJECTION {:type \"albersUsa\"}\n :STROKE hc/RMV\n :GEOENCODING\n {:longitude {:field \"longitude\", :type \"quantitative\"},\n  :latitude {:field \"latitude\", :type \"quantitative\"},\n  :tooltip [{:field :GTTFIELD, :type :GTTTYPE}\n            {:field \"longitude\", :type \"quantitative\"}\n            {:field \"latitude\", :type \"quantitative\"}],\n  :size :SIZE})\n\n", :out-height "900px", :eid "ed-visdefs", :height "900px"}}, :specs []}} {:cljs {:label "Cljs", :opts {:order :row, :eltsper 1, :size "auto", :wrapfn {:tid :cljs, :$split nil, :out-width "1300px", :fn [quote editor-repl-tab], :layout :left-right, :ns cov2.code, :ed-out-order :first-last, :width "730px", :md-defaults nil, :src "\n\n:cljs\n\n\n;;; States to show selections\n;;;\n(def state-choices\n  (->> code->state vals sort\n    (mapv (fn[id label] {:id id :label label}) (range))))\n\n(def id->code\n  (->> state-choices\n    (mapv (fn[m] [(m :id) (-> m :label state->code)])) (into {})))\n\n(defn selection-code-vec [state-set]\n  (mapv #(id->code %) state-set))\n\n\n;;; Graphs to show selections and layers\n;;;\n(def graph-choices\n  [{:id 0 :label \"Positive increase\" :field :posavg}\n   {:id 1 :label \"Positivity %\" :field :perpos}\n   {:id 2 :label \"death increase\" :field :dthavg}\n   {:id 3 :label \"hospital increase\" :field :hosavg}\n   {:id 4 :label \"hospitalized\" :field :hospitalizedCurrently}\n   {:id 5 :label \"total positive\" :field :positive}\n   {:id 6 :label \"total death\" :field :death}])\n\n(def graph-id->code\n  (->> graph-choices\n    (mapv (fn[m] [(m :id) (-> m :field)])) (into {})))\n\n(defn graph-selection-code-vec [graph-set]\n  (mapv graph-id->code graph-set))\n\n(def layer-info\n  {:posavg {:y :posavg :title \"PosIncrease\"}\n   :perpos {:y :perpos :title \"Positivity\"}\n   :dthavg {:y :dthavg :title \"DeathIncrease\"}\n   :hosavg {:y :hosavg :title \"HospitalIncrease\"}\n   :hospitalizedCurrently {:y :hospitalizedCurrently :title \"Hospitalizations\"}\n   :positive  {:y :positive :title \"Positives\" :yscale {:type :log}}\n   :death  {:y :death :title \"Deaths\" :yscale {:type :log} :ygrid true}})\n\n(defn get-layer-info [layer-keys]\n  (mapv layer-info layer-keys))\n\n(defn make-layers [field-info width color]\n  (mapv (fn[fi]\n          (hc/xform\n           ht/line-chart\n           :WIDTH width :HEIGHT 700\n           :POINT true\n           :TRANSFORM [{:filter {:field \"field\" :equal (name (fi :y))}}]\n           :COLOR color\n           :X :stgdate :XTYPE \"temporal\" :XTTITLE \"Date\" :XTITLE \"Date\"\n           :Y (fi :y) :YTTITLE (fi :title) :YTITLE (fi :title)\n           :YSCALE (fi :yscale hc/RMV) :YGRID (fi :ygrid hc/RMV)))\n        field-info))\n\n\n;;; Base \"schemas\" for template transformation when on-change functions called\n;;;\n(defn daily-schema [layer-keys]\n  (let [color {:field \"field\" :type \"nominal\"\n               :legend {:type \"symbol\" :offset 0 :title \"Type\"}}\n        width 1000]\n    [:LAYER (make-layers (get-layer-info layer-keys) width color)\n     :RESOLVE {:scale {\"y\" \"independent\"}}]))\n\n(def state-schema\n  [:VCONCAT [(hc/xform\n              ht/line-chart :POINT true :WIDTH 1000 :HEIGHT 600\n              :TOOLTIP [{:field :state :type \"nominal\" :title \"State\"}\n                        {:field :stgdate :type \"temporal\" :title \"Date\"}\n                        {:field :posavg :type \"quantitative\" :title \"Increase\"}\n                        ]\n              :X :stgdate :XTYPE \"temporal\" :XTITLE \"Date\"\n              :XSCALE {:domain {:selection \"brush\"}}\n              :Y :posavg :YTITLE \"PosIncrease\"\n              :YSCALE {:type \"log\"} :YGRID true :COLOR \"code\")\n             (hc/xform\n              ht/line-chart :WIDTH 1000, :HEIGHT 60\n              :X :stgdate :XTYPE \"temporal\" :XTITLE \"Date\"\n              :SELECTION {:brush {:type \"interval\", :encodings [\"x\"]}}\n              :Y :posavg :YTITLE \"PosIncrease\"\n              :YSCALE {:type \"log\"} :YGRID true :COLOR \"code\")]])\n\n\n;;; Date converter and selectors for single daily\n;;;\n(defn date-to-idate [date-stg]\n  (-> date-stg (str/split #\"-\")\n    (->> (map js/parseInt))\n    ((fn[[y m d]] (+ (* 10000 y) (* 100 m) d)))))\n\n(defn data-start-end [start end data]\n  (let [start-int (inc (date-to-idate start))\n        end-int (date-to-idate end)]\n    (->> data\n         (drop-while #(> (% :date) start-int))\n         (take-while #(>= (% :date) end-int)))))\n\n\n;;; Define the reactive component ratoms\n;;; Not great names here for most part - historical reasons...\n(do\n  (sc/add-ratom :postype :pos100k)\n  (sc/add-ratom :savg (str 7))\n  (sc/add-ratom :graphs #{1 2})\n  (sc/add-ratom :state-daily 20)\n  (sc/add-ratom :msavg (str 7))\n  (sc/add-ratom :multi #{6 20 18 28 38 44}))\n\n\n\n\n;;; Define on-change selection functions\n;;;\n:mixed\n\n;;; Daily by States\n;;;\n(defn get-data-set [state window graphs start end]\n  (let [data (daily-memoized state window)]\n    (->> data first\n      (drop-while #(= (% :positive) 0))\n      (filter #(> (% :death) 0))\n      (data-start-end start end)\n      (mapv #(mapv (fn[g] (assoc % :field g)) graphs))\n      (apply concat) vec)))\n\n(defn update-daily [id choices template fid vid]\n  (let [state (->> choices (filter #(= (% :id) id)) first :label state->code)\n        ra (sc/get-ratom :state-daily)\n        info (format \"%s Daily\" (code->state state))\n        win  (hmi/get-ddb [:cov2 :daywin])\n        graphs (hmi/get-ddb [:cov2 :graphs])\n        dates (hmi/get-ddb [:cov2 :dates])\n        data (get-data-set [state] win graphs (dates :start) (dates :end))]\n    (hmi/printchan[id state (count data)])\n    (hmi/update-ddb [:cov2 :stateid] id)\n    (reset! ra id)\n    (hmi/visualize\n     (apply hc/xform template\n            :FID fid :VID vid :DATA data :TITLE info\n            (daily-schema graphs))\n     (js/document.getElementById (name vid)))))\n\n(defn sliding-avg [savg ra]\n  (reset! ra (str savg))\n  (hmi/update-ddb [:cov2 :daywin] savg)\n  (let [f (sc/get-symxlate 'state-daily)\n        stateid (hmi/get-ddb [:cov2 :stateid])]\n    (f stateid)))\n\n(defn graph-selection [graph-set ra]\n  (reset! ra graph-set)\n  (hmi/update-ddb [:cov2 :graphs] (graph-selection-code-vec graph-set))\n  (let [f (sc/get-symxlate 'state-daily)\n        stateid (hmi/get-ddb [:cov2 :stateid])]\n    (f stateid)))\n\n\n;;; Multi Daily\n;;;\n(defn state-selection [state-set ra]\n  (let [win  (hmi/get-ddb [:cov2 :daywin2])\n        data (daily-memoized (selection-code-vec state-set) win)]\n    (reset! ra state-set)\n    (hmi/printchan (format \"Selection %s\" state-set))\n    (hmi/visualize\n     (apply hc/xform ht/vconcat-chart\n            :FID :fmulti :VID :vmulti\n            :DATA (->> data (apply concat)\n                    (filter #(> (% :posavg) 0))\n                    vec)\n            :TITLE \"Daily Increases by State\" state-schema)\n     (js/document.getElementById (name :vmulti)))))\n\n(defn sliding-avg-multi [savg ra]\n  (reset! ra (str savg))\n  (hmi/update-ddb [:cov2 :daywin2] savg)\n  (let [f (sc/get-symxlate 'state-selection)\n        ra (sc/get-ratom :multi)]\n    (f (deref ra) ra)))\n\n\n\n\n;;; Init DB and register on-change functions for hiccup translation\n;;;\n:cljs\n\n(do\n  (hmi/update-ddb\n   [:cov2 :daywin] (-> (sc/get-ratom :savg) deref js/parseInt)\n   [:cov2 :stateid] (deref (sc/get-ratom :state-daily))\n   [:cov2 :graphs] (-> (sc/get-ratom :graphs) deref graph-selection-code-vec)\n   [:cov2 :daywin2] (-> (sc/get-ratom :msavg) deref js/parseInt)\n   [:cov2 :dates] {:start (sc/get-cur-date) :end \"2020-04-01\"}) :done)\n\n\n;;; Daily by States\n(let [choices state-choices]\n  (hmi/update-ddb [:cov2 :baseinfo] [:daily :bystate])\n  (sc/add-symxlate\n   'state-daily\n   #(update-daily % choices cov2-daily-states :daily :bystate)))\n\n(sc/add-symxlate\n 'sliding-avg #(let [ra (sc/get-ratom :savg)] (sliding-avg % ra)))\n\n(sc/add-symxlate\n 'graph-selection-daily\n #(let [ra (sc/get-ratom :graphs)] (graph-selection % ra)))\n\n\n;;; Multi Daily\n(sc/add-symxlate\n 'state-selection\n #(let [ra (sc/get-ratom :multi)] (state-selection % ra)))\n\n(sc/add-symxlate\n 'sliding-avg-multi\n #(let [ra (sc/add-ratom :msavg (str 7))] (sliding-avg-multi % ra)))\n\n\n\n\n\n\n\n\n:none\n\n(first (get-data-set [\"MA\"] 7 [:perpos :hosavg :dthavg]\n              \"2020-9-30\" \"2020-04-01\"))\n\n\n(sc/add-symxlate\n 'foo-fn #(let [ra (sc/get-ratom :foo)] (reset! ra (str %))))\n\n(sc/add-symxlate\n 'test-slider-fn #(hmi/printchan (format \"Slider %s\" %)))\n\n(sc/add-symxlate\n 'test-selection-fn\n #(let [ra (sc/get-ratom :multi)]\n    (reset! ra %)\n    (hmi/printchan (format \"Selection %s\" %))))\n\n\n\n\n:end", :out-height "900px", :eid "ed-cljs", :height "900px"}}, :specs []}} {:cov2 {:label "US Cov2 Overview", :opts {:order :row, :eltsper 2, :rgap "20px", :cgap "20px", :size "auto", :wrapfn {:tid :cov2, :$split 0, :out-width "730px", :fn [quote interactive-doc-tab], :cmfids {:cm 0, :fm 0}, :ns cov2.code, :ed-out-order :first-last, :width "730px", :md-defaults nil, :src "\n:cljs\n\n(def geo-schema\n  [:DATA state-data\n   :WIDTH 1000 :HEIGHT 700\n   :TOOLTIP [{:field \"name\" :type \"nominal\"}\n             {:field \"pop\"  :type \"quantitative\"}\n             {:field \"positive\" :type \"quantitative\"}\n             {:field \"pos100K\" :type \"quantitative\"}]\n   :TRANSFORM [{:lookup \"id\",\n                :from {:data {:url us-10m\n                              :format {:type \"topojson\" :feature \"states\"}}\n                       :key \"id\"}\n                :as \"geo\"}]])\n\n(defn geopos [x]\n  (let [encoding-map {:pos [:X \"positive\"]\n                      :logpos [:X \"positive\" :YSCALE {:type \"log\"}]\n                      :pos100k [:X \"pos100K\"]\n                      :logpos100k [:X \"pos100K\" :YSCALE {:type \"log\"}]}\n        ra (sc/get-ratom :postype)]\n    (reset! ra x)\n    (hmi/visualize\n     (apply hc/xform geo-choro\n            :FID :fgeo :VID :vgeo\n            (concat (encoding-map x) geo-schema))\n     (js/document.getElementById (name :vgeo)))))\n\n\n(sc/add-symxlate\n 'geopos-fn #(do (hmi/printchan (format \"Radio pushed %s\" %)) (geopos %)))\n\n\n:none\n\n\n(let [rbmodel (sc/get-ratom :postype)\n      labels {:pos \"Positive\" :logpos \"Log Positive\"\n              :pos100k \"Positive / 100K\" :logpos100k \"Log Positive / 100K\"}\n      rbuttons (doall\n                (for [b [:pos :logpos :pos100k :logpos100k]]\n                  ^{:key b}\n                  (x